def run(value_list):
    """
    Calculates the average voyage revenue in 2018 and 2019 from the provided data.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the average voyage revenue (float) and the scale (string).
    """
    revenue_2018 = 0
    revenue_2019 = 0
    count = 0

    for item in value_list:
        if item['header1'] == '2018':
            revenue_2018 += item['number_value']
            count += 1
        elif item['header1'] == '2019':
            revenue_2019 += item['number_value']
            count += 1

    if count == 0:
        return (0.00, "")

    average_revenue = (revenue_2018 + revenue_2019) / count
    scale = item['header3'].split('except ')[-1].replace('USD ‘000', '').replace(' ', '').replace(',', '.')
    return (round(average_revenue, 2), scale)

def run(value_list):
    """
    Calculates the proportion of balances in the Application Software and Process Technologies
    segments over total balances in all segments at December 31, 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    total_balances_2018 = 0
    app_software_2018 = 0
    process_tech_2018 = 0

    for item in value_list:
        if item['category'] == 'Balances at December 31, 2018':
            total_balances_2018 += item['number_value']
            if item['header1'] == 'Application Software':
                app_software_2018 += item['number_value']
            if item['header1'] == 'Process Technologies':
                process_tech_2018 += item['number_value']

    if total_balances_2018 == 0:
        return (0.00, "")

    proportion = (app_software_2018 + process_tech_2018) / total_balances_2018
    return (round(proportion, 2), "percent")
